import { createApp } from 'vue'
import App from './App.vue'
import router from './router'
import store from './store/store'
//import { tooltip } from './assets/tooltip'

const app = createApp(App);

//app.directive('tooltip', tooltip)

app.use(router);
app.use(store);
app.mount('#app');
